            <IconDiv>
              <Home color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox href={"./LogIn#"}
                ffamily={"light"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Home </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv>
              <Users color={properties.lightGrey} />
